#project euler2
def fibonacci(n=4000000):
  a,b = 1,1
  while a < n:
    if a%2 == 0:
      yield a 
    a,b = b,a+b 
#project euler 4
def palindromatic():
  mylist = [] 
  for a in range(999,100,-1):
    for b in range(999,100,-1):
      n = a*b
      if str(n) == str(n)[::-1]:
        mylist.append(n)
  return max(mylist)
#project euler 5 
def smallest_multiple(step=20):
  check_list = [11,13,14,16,17,18,19,20] 
  for num in range(step,999999999,step):
    if all(num % n == 0 for n in check_list):   
      return num 
  return None 
#project euler 11
def product_series(n=''): 
  largest_product = 0 
  for i in range(0,len(n)-13):
    product = 1
    for x in range(i,i+13):
      product *= int(n[x])
    if product > largest_product:
      largest_product = product 
  return largest_product 
#project euler 9 
def special_triplet(n=1000):
  for a in range(3,n):
    for b in range(4,n):
      c = n - a - b
      if c**2 == a**2 + b**2:
        return a*b*c
